import React from "react";
import "../styles/main.css";
const Main = () => {
  return (
    <div id="bg">
      <div className="heading">
        <div className="title">
          <span>Project Name</span>
        </div>
        <div className="time">
          <span>2:30:23</span>
        </div>
        <div className="leave">
          <button className="btn" id="leave">
            Leave
          </button>
        </div>
      </div>
      <div className="body">
        <div className="videobig">
          <div className="videosmall"></div>
        </div>
        <div className="subtitle">
          <span className="text">Subtitles..</span>
        </div>

      </div>

    </div>
  );
};

export default Main;
